import React from "react";
import { Scene } from "sprite-react";

interface CharProps {}

const charComponent: React.FC<CharProps> = (props) => {
  return (
    <div>
      <h1>Char</h1>
      <Scene>
        <layer id="fglayer" handleEvent={true}>
          <group>
            <sprite
              pos={[200, 100]}
              size={[50, 50]}
              bgcolor="red"
              onClick={function () {
                this.attr("bgcolor", "blue");
              }}
            ></sprite>
            <Block />
          </group>
        </layer>
      </Scene>
    </div>
  );
};

export default charComponent;
